import React from 'react';
import './App.css';

// Constants 
import {INITIALCITY} from './constants/weather';

// Components
import WeatherLocation from './components/WeatherLocation';

function App() {
  return (
    <div className="App">
      <div className="App-container">
        <WeatherLocation city={INITIALCITY} />
      </div>
    </div>
  );
}

export default App;
